import Button from "../UI/Button/Button";
import classes from "./header.module.css";

function Header() {
  return (
    <header>
      <nav className={classes.main_nav}>
        <Button size="lg">Logo</Button>
        <Button size="sm">Logo</Button>
      </nav>
    </header>
  );
}

export default Header;
